<div class="" style="position: absolute; left: 0px; top: 0px; height: 700px; width: 960px; min-height: 700px; display: flex; flex-direction: column; align-items: center; justify-content: center" absolute="true">

We present you a new tool in our tool box.

# DevNet

Let's find out how it can elevate your workflow and simplify your tasks.
</div></script></section><section data-markdown><script type=text/template><!-- .slide: class="drop" -->
<div class="" style="position: absolute; left: 0px; top: 0px; height: 700px; width: 960px; min-height: 700px; display: flex; flex-direction: column; align-items: center; justify-content: center" absolute="true">

# Challenges
</div></script></section><section data-markdown><script type=text/template><!-- .slide: class="drop" -->
<div class="" style="position: absolute; left: 0px; top: 0px; height: 700px; width: 960px; min-height: 700px; display: flex; flex-direction: column; align-items: center; justify-content: center" absolute="true">

### **High-level entry point**
Scripting can be tricky, involving complex setups and requirements.

### **It is not readable**
Difficult to receive good-looking outputs.

### **Running laptop 24/7**
No simple way to plan or schedule an execution of a script.

### **Plain text passwords**
Risky secrets handling.
</div></script></section><section data-markdown><script type=text/template><!-- .slide: class="drop" -->
<div class="" style="position: absolute; left: 0px; top: 0px; height: 700px; width: 960px; min-height: 700px; display: flex; flex-direction: column; align-items: center; justify-content: center" absolute="true">

# Possibilities
</div></script></section><section data-markdown><script type=text/template><!-- .slide: class="drop" -->
<div class="" style="position: absolute; left: 0px; top: 0px; height: 700px; width: 960px; min-height: 700px; display: flex; flex-direction: column; align-items: center; justify-content: center" absolute="true">

### **Simplified execution** 
Run Tasks effortlessly without any setup, directly from Azure Pipeline. No configurations needed.

### **Results, straight to your Inbox**
Receive results via email, right when you need them.

### **Time flexibility**
Whether you demand immediate action or prefer scheduled tasks

### **No/All firewall rules**
Forget about those pesky firewalls. Traffic from Azure to network devices are open from day one.
</div></script></section><section data-markdown><script type=text/template><!-- .slide: class="drop" -->
<div class="" style="position: absolute; left: 0px; top: 0px; height: 700px; width: 960px; min-height: 700px; display: flex; flex-direction: column; align-items: center; justify-content: center" absolute="true">

# Use Cases
</div></script></section><section data-markdown><script type=text/template><!-- .slide: class="drop" -->
<div class="" style="position: absolute; left: 0px; top: 0px; height: 700px; width: 960px; min-height: 700px; display: flex; flex-direction: column; align-items: center; justify-content: center" absolute="true">

Let's find out real-world and implemented use cases

### **Data Magic**: 
Fetch data from our CMDB and whip up insightful reports with ease.

### **Network Ninja**
Update your network device configurations effortlessly and keep your systems in sync.

### **AAA Awesomeness**
Tap into AAA servers for data and insights.

### **Commander in Chief**
Connect to network devices, execute commands, and watch its magic.
</div></script></section><section data-markdown><script type=text/template><!-- .slide: class="drop" -->
